import "./Phonetic.css";

export default function Phonetic(props) {
    console.log(props.phonetic);
    return (
      <div className="phonetic">
        <div className="audio-player">
          <audio style="width" controls src={props.phonetic.audio}></audio>
          <span>{props.phonetic.text}</span>
        </div>
      </div>
    );
}
